export const CHOICE_TYPE = {
    SELECT: {
        type: 'select',
        value: 3,
        icon: 'fas fa-box-open'
    },
    RADIO: {
        type: 'radio',
        value: 1,
        icon: 'fas fa-check-circle'
    },
    CHECKBOX: {
        type: 'checkbox',
        value: 2,
        icon: 'fas fa-check-square'
    }
};
